INSERT INTO `news` (`id`, `post_id`, `title`, `url`, `thumbnail`, `description`, `detail`, `order`)
VALUES
	(2,1326,'Tin tức 3','tin-tuc-3',NULL,'',NULL,0),
	(3,1327,'dfa adf asd','dfa-adf-asd',NULL,'',NULL,0),
	(4,1328,'sa dfasd adfa df','sa-dfasd-adfa-df',NULL,'',NULL,0),
	(5,1329,'adsf asdfa df','adsf-asdfa-df',NULL,'','<p>&nbsp;asdfadfa dfasdf<img alt=\"\" src=\"/upload/images/temp/112.jpg\" style=\"height:720px; width:720px\" /></p>\n',0),
	(6,7,'Đèn LED - bước đột phá trong công nghệ chiếu sáng','den-led-buoc-dot-pha-trong-cong-nghe-chieu-sang',NULL,'','<p>Giải thưởng Nobel Vật lý 2014 được công bố hôm 7/10, tôn vinh phát minh các điốt phát quang LED (Light Emitting Diode) xanh dương, có khả năng tạo ra các nguồn ánh sáng trắng tiết kiệm năng lượng và sáng hơn. Các nhà khoa học được vinh danh là Isamu Akasaki, Hiroshi Amano và Shuji Nakamura.</p>\n\n<p>Phát minh LED xanh dương có từ những năm 1990, được đánh giá là có vai trò không nhỏ trong việc tạo ra ánh sáng trắng theo một phương thức hoàn toàn mới, đem lại lợi ích cho con người.</p>\n\n<p style=\"text-align: center;\"><img alt=\"Ánh sáng đèn LED ở thủ đô Tokyo, Nhật Bản. Ảnh: Reuters.\" src=\"/upload/images/tintuc/59f8666678fb5_1509451366.jpg\" style=\"height:350px; width:500px\" /></p>\n\n<p style=\"text-align: center;\">Ánh sáng đèn LED ở thủ đô Tokyo, Nhật Bản. Ảnh:&nbsp;<em>Reuters.</em></p>\n\n<p><strong>Thắp sáng thế giới</strong></p>\n\n<p>Thời xa xưa, con người phải sử dụng lửa để tạo ra nguồn sáng. Từ thế kỷ 19, phương pháp dùng đèn khí trở nên phổ biến và sau đó là bóng đèn dây tóc của Thomas Edison. Ngày nay, chúng ta có bóng đèn huỳnh quang và đèn huỳnh quang compact (CFL). Những công nghệ này giúp nhiều người được tiếp cận với ánh sáng hơn, trong khi có thể tiết kiệm năng lượng hơn so với trước đây.</p>\n\n<p>LED được coi là một thế hệ công nghệ chiếu sáng mới. So với bóng đèn CFL và bóng đèn dây tóc, đèn LED có hiệu quả hơn lần lượt gấp 4 lần và 15 lần. So với bóng đèn huỳnh quang, nó tiêu thụ ít năng lượng hơn và không chứa thủy ngân độc hại.</p>\n\n<p>Không chỉ tiết kiệm năng lượng, loại đèn này còn có tuổi thọ kéo dài, gấp khoảng 30 lần so với bóng đèn sợi đốt. Nhiều bóng đèn LED có tuổi thọ 25.000 giờ, tức tương đương 17 năm sử dụng nếu dùng để chiếu sáng 4 giờ mỗi ngày.</p>\n\n<p>Quay trở lại những năm 1980, khi điốt chỉ có thể phát quang đỏ và xanh lá, ánh sáng không đủ để thắp sáng một căn phòng. Nhưng chỉ 10 năm sau đó, với việc phát triển LED xanh dương của Nakamura dựa trên nghiên cứu trước đó của Akasaki và Amano, sự kết hợp này có thể tạo ra nguồn ánh sáng trắng hiệu quả hơn nhiều lần.</p>\n\n<p>Kể từ đó, đèn LED dần trở nên phổ biến và được ứng dụng rộng rãi hơn, từ ánh sáng đường phố, đèn giao thông, đến màn hình máy tính hay điện thoại thông minh. Thông báo của Viện Hàn lâm Khoa học hoàng gia Thụy Điển cho hay, phát minh này đánh dấu sự ra đời của công nghệ có thể thay đổi thế giới</p>\n\n<p>Hơn 1,5 tỷ người trên thế giới hiện nay chưa được tiếp cận với các mạng lưới điện. Vì không có điện, nhiều hộ gia đình vẫn phải đốt củi hay sử dụng khí để thắp sáng. Điều này không những không hiệu quả mà thậm chí còn gây ô nhiễm không khí trong nhà và dẫn tới tử vong. Sự thiếu thốn đó còn gây khó khăn cho nhiều đứa trẻ ở độ tuổi đến trường.</p>\n\n<p>Đèn LED thường có mức đầu tư ban đầu cao hơn so với các loại bóng đèn khác. Tuy nhiên, giá của nó liên tục được giảm theo thời gian và dự kiến xuống mức được áp dụng rộng rãi ở các nước nghèo. Việc sử dụng đèn LED có thể cải thiện chất lượng cuộc sống của họ.</p>\n\n<p>Hạn chế ảnh hưởng của nóng lên toàn cầu</p>\n\n<p>Theo các nhà nghiên cứu, chiếu sáng là hoạt động tiêu tốn nhiều năng lượng, ước tính khoảng 17% lượng điện tiêu thụ tính riêng ở Mỹ. Lợi ích tiết kiệm năng lượng mà đèn LED có thể mang lại đặc biệt lớn ở các quốc gia phát triển.</p>\n\n<p>Bằng cách sử dụng đèn LED, ảnh hưởng từ các nguồn chiếu sáng gây ô nhiễm có thể được hạn chế. Do yêu cầu công suất thấp, đèn LED có thể được hỗ trợ nhờ điện năng lượng mặt trời giá rẻ. Trong tương lai, nếu chi phí sử dụng ngày càng rẻ hơn, chúng có thể thay thế các loại đèn huỳnh quang hay đèn sợi đốt vốn được sử dụng phổ biến ở châu Âu hay Mỹ.</p>\n\n<p>Theo lý thuyết, đèn LED có thể tạo ra sự thay đổi để giải quyết vấn đề năng lượng. Hầu hết các kế hoạch nhằm giảm khí thải nhà kính và thúc đẩy hiệu quả năng lượng tại Mỹ và châu Âu đều hình dung được rằng, đèn LED có thể thay đổi các công nghệ chiếu sáng hiện nay cho đến năm 2050.</p>\n\n<p style=\"text-align: right;\"><strong>Thùy Linh&nbsp;</strong>(Theo&nbsp;<em>Vox</em>)</p>\n',0);
